use std::collections::HashSet;

use base64::prelude::*;
use tonlib_core::cell::BagOfCells;

#[test]
fn account_proof_cell() {
    let entry = "";
    let bytes_entry = BASE64_STANDARD.decode(entry).unwrap();
    let boc = BagOfCells::parse(&bytes_entry).unwrap();
    let first_root_hash = boc.roots[0].cell_hash().to_hex();
    let second_root_hash = boc.roots[1].cell_hash().to_hex();
    let expected_hashes = HashSet::from([
        "ceb74a112c1d4e53e4bbab30fe1a0153b10ffeaa33a828818dd052eb58004d4a",
        "1b8709beb7f8fe24f17fec2f477bb77fac399920b0228794a519f9e3961db29c",
    ]);
    let real_hashes = HashSet::from([first_root_hash.as_str(), second_root_hash.as_str()]);
    // if hashes of two roots are correct, we can be sure that the whole trees of cells are correct
    assert_eq!(real_hashes, expected_hashes);

    // then we can serialize again
    let bytes_entry_again = boc.serialize(false).unwrap();
    let boc_again = BagOfCells::parse(&bytes_entry_again).unwrap();
    let first_root_hash = boc_again.roots[0].cell_hash().to_hex();
    let second_root_hash = boc_again.roots[1].cell_hash().to_hex();
    let real_hashes = HashSet::from([first_root_hash.as_str(), second_root_hash.as_str()]);
    assert_eq!(real_hashes, expected_hashes);
}

